  longlong *system_context_base_pointer;
  longlong system_initialization_result;
  system_uint64_t *system_module_data_pointer;
  system_uint64_t *system_config_data_pointer;
  system_uint64_t *system_temp_data_pointer;
  system_uint64_t *system_stack_frame_pointer;
  system_code *system_core_init_function;
  
  system_context_base_pointer = (longlong *)InitializeSystemCore();
  system_buffer_pointer = (system_uint64_t *)*system_context_base_pointer;
  system_char_check = *(char *)((longlong)system_buffer_pointer[SYSTEM_ARRAY_INDEX_SECOND] + SYSTEM_INIT_OFFSET_CHAR_CHECK);
  system_core_init_function = InitializeSystemCore;
  system_config_data_pointer = system_buffer_pointer;
  system_module_data_pointer = (system_uint64_t *)system_buffer_pointer[SYSTEM_ARRAY_INDEX_SECOND];
  while (system_char_check == '\0') {
    system_comparison_result = memcmp(system_module_data_pointer + 4,&g_system_initialized,SYSTEM_INIT_SIZE_COMPARE);
    if (system_comparison_result < 0) {
      system_temp_data_pointer = (system_uint64_t *)system_module_data_pointer[SYSTEM_ARRAY_INDEX_THIRD];
      system_module_data_pointer = system_config_data_pointer;
    }
    else {
      system_temp_data_pointer = (system_uint64_t *)*system_module_data_pointer;
    }
    system_config_data_pointer = system_module_data_pointer;
    system_module_data_pointer = system_temp_data_pointer;
    system_char_check = *(char *)((longlong)system_temp_data_pointer + SYSTEM_INIT_OFFSET_CHAR_CHECK);
  }
  if ((system_config_data_pointer == system_buffer_pointer) || (system_comparison_result = memcmp(&g_system_initialized,system_config_data_pointer + 4,SYSTEM_INIT_SIZE_COMPARE), system_comparison_result < 0)) {
    system_initialization_result = InitializeSystemCore(system_context_base_pointer);
    InitializeSystemCore(system_context_base_pointer,&system_stack_frame_pointer,system_config_data_pointer,system_initialization_result + SYSTEM_INIT_OFFSET_STACK_PARAM,system_initialization_result);
    system_config_data_pointer = system_stack_frame_pointer;
  }
  system_config_data_pointer[SYSTEM_ARRAY_INDEX_SEVENTH] = SYSTEM_INIT_MAGIC_COOKIE_1;
  system_config_data_pointer[SYSTEM_ARRAY_INDEX_EIGHTH] = SYSTEM_INIT_MAGIC_COOKIE_2;
  system_config_data_pointer[SYSTEM_ARRAY_INDEX_NINTH] = &g_system_context;
  system_config_data_pointer[SYSTEM_ARRAY_INDEX_TENTH] = SYSTEM_INIT_VALUE_ZERO;
